import React, { useEffect } from "react";
import { FormStepper } from "./Stepper";
import { useForm, FormProvider } from "react-hook-form";
import Modal from '@mui/material/Modal'


export default function WrapStepper()
{
    const methods = useForm({ mode: "onBlur" });
    const { watch, errors } = methods;
  
    useEffect(() => {
      console.log("FORM CONTEXT", watch(), errors);
    }, [watch, errors]);
    return(
        <FormProvider {...methods}>
        <Modal style={{display:'flex',alignItems:'center',justifyContent:'center'}} disableEnforceFocus open={true}  aria-labelledby="modal-modal-title" aria-describedby="modal-modal-description">
            <FormStepper />
        </Modal>
        
      </FormProvider>
    )
}
